entity.p:
Hackney Wick is a station on the North London Line in the area of Hackney Wick, East London. It is in Travelcard Zone 2. The station and all trains serving it are operated by London Overground. It opened on 12 May 1980[3] by British Rail on the re-routed line which bypassed the site of the former Victoria Park station as part of the CrossTown Link line between North Woolwich and Camden Road stations.
Between Spring 2017 and May 2018 the station was rebuilt and modernised, including replacement of the footbridge by a subway.  The new subway, in addition to linking the two platforms will, later in 2018, provide a cycle and pedestrian link between Hackney and Tower Hamlets.
